import React from "react";

const Table = props => {
  let tableRow = <tr></tr>;
  if (props.weather)
    tableRow = (
      <tr>
        <td>Fish</td>
      </tr>
    );
  return (
    <table>
      <thead>
        <tr>
          <th>Condition</th>
          <th>Day</th>
          <th>Location</th>
        </tr>
      </thead>
      <tbody>{tableRow}</tbody>
    </table>
  );
};

export default Table;
